import "./Items.css";
import { useNavigate } from "react-router-dom";
import SingleItemList from "./SingleItemList";
export default function Items({
  items,
  addToCart,
  isLogged,
  userIdLogged,
  fetchAgain,
  handleDeleteItem,
  setNavigateItem,
  searchItemsArray,
}) {
  const navigate = useNavigate();
  function handleAddItems() {
    navigate("/addItem");
  }

  return (
    <>
      <section id="items">
        <div className="items">
          {/* if the length is bigger than 0 then we searched for something */}
          {searchItemsArray.length > 0 &&
            searchItemsArray[0] !== "null" &&
            searchItemsArray.map((value, key) => (
              <SingleItemList
                value={value}
                addToCart={addToCart}
                key={key}
                isLogged={isLogged}
                userIdLogged={userIdLogged}
                fetchAgain={fetchAgain}
                handleDeletion={handleDeleteItem}
                setNavigateItem={setNavigateItem}
              />
            ))}
          {/* if the length is 0 we didnt search anything -> show the default items */}
          {searchItemsArray.length === 0 &&
            items.map((value, key) => (
              <SingleItemList
                value={value}
                addToCart={addToCart}
                key={key}
                isLogged={isLogged}
                userIdLogged={userIdLogged}
                fetchAgain={fetchAgain}
                handleDeletion={handleDeleteItem}
                setNavigateItem={setNavigateItem}
              />
            ))}

          {searchItemsArray[0] === "null" && (
            <div className="emptySearchMessage" style={{ color: "black" }}>
              <p>No items to Show!</p>
            </div>
          )}
        </div>
      </section>
      {isLogged && (
        <button className="btn-add-items" onClick={handleAddItems}>
          Add items
        </button>
      )}
    </>
  );
}
